import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function HostCarInfo() {
    const { id } = useParams()
    const [car, setCar] = useState(0);
    useEffect(() => {
        const res = JSON.parse(localStorage.getItem("cars"));
        console.log(res);
        const data = res.filter(c => c.id === "1" && c.hostId === "1");
        setCar(data);
    }, []);
    console.log(car);
    return (
      <h1>Host Car Info goes here.</h1>
    );
};
